import java.io.*;
import java.util.*;

public class BellmanFord4 {

    public int n; // number of nodes
    public LinkedList<Edge> edges; // the graph is represented as a list of edges
    public int source; // the source node
    public int[] p; // array of parents
    public double[] d; // array of distances from the source
    public Edge[] sp; // sp[v] is the edge connecting v and its parent p[v]
    public HashMap<String, Integer> nodi;

    /**
     * Edge of a weighted, directed graph
     */
    private class Edge {
        public int src;
        public int dst;
        public double w;

        public Edge(int src, int dst, double w) {
            this.src = src;
            this.dst = dst;
            this.w = w;
        }
    }

    /**
     * The constructor reads the graph from the input file
     *
     * @param inputf input file name
     */
    public BellmanFord4(String inputf) {
        readGraph(inputf);
    }

    /**
     * Prints the shortest path from |source| to |dst|
     */
    protected void print_path(int dst) {
        if (dst == source)
            System.out.print(dst);
        else if (p[dst] < 0)
            System.out.print("Irraggiungibile");
        else {
            print_path(p[dst]);
            System.out.print("->" + dst);
        }
    }

    /**
     * Dump the shortest path tree to standard output.
     */
    public void print_paths() {
        System.out.println("Source = " + source);
        System.out.println();
        System.out.println("   s    d         dist path");
        System.out.println("---- ---- ------------ -------------------");
        for (int dst = 0; dst < n; dst++) {
            System.out.printf("%4d %4d %12.4f ", source, dst, d[dst]);
            print_path(dst);
            System.out.println();
        }
    }

    /**
     * Read the input graph from a file named inputf
     *
     * @param inputf input file name
     */
    private void readGraph(String inputf) {
        try {
            Scanner scanner = new Scanner(new File(inputf));
            nodi = new HashMap<String, Integer>();
            double maxCapacity = 0.0;
            int totalNodes = 0;
            edges = new LinkedList<Edge>();
            while (scanner.hasNext()) {
                String line = scanner.nextLine().trim();

                if (line.startsWith("NODES")) {
                    while (!line.startsWith(")")) {
                        line = scanner.nextLine().trim();

                        if (line.startsWith(")")) {
                            continue;
                        }
                        String id = line.split(" ")[0];

                        nodi.put(id, totalNodes);
                        totalNodes++;

                    }
                }
            }
            scanner.close();

            scanner = new Scanner(new File(inputf));

            while (scanner.hasNext()) {
                String line = scanner.nextLine().trim();
                if (line.startsWith("LINKS")) {
                    while (!line.startsWith(")")) {
                        line = scanner.nextLine().trim();

                        if (line.startsWith(")")) {
                            continue;
                        }

                        int source = nodi.get(line.split(" ")[2]);
                        int target = nodi.get(line.split(" ")[3]);
                        double preInstalledCapacity = Double.parseDouble(line.split(" ")[5]);

                        if (preInstalledCapacity > maxCapacity) {
                            maxCapacity = preInstalledCapacity;
                        }

                        edges.add(new Edge(source, target, preInstalledCapacity));
                        edges.add(new Edge(target, source, preInstalledCapacity));

                    }
                }

            }

            scanner.close();
            this.n = totalNodes;

            for (Edge e : edges) {
                e.w = maxCapacity / e.w;
            }
        }

        catch (FileNotFoundException e) {
            System.out.println("File not found: " + inputf);
        }
    }

    /**
     * Executes the Bellman-Ford shortest paths algorithm using s as the
     * source node.
     *
     * @param s source node
     * @result true if negative cycle detected
     */
    public boolean shortestPaths(int s) {
        d = new double[n];
        p = new int[n];
        sp = new Edge[n];

        Arrays.fill(d, Double.POSITIVE_INFINITY);
        Arrays.fill(p, -1);

        d[s] = 0.0;
        for (int i = 0; i < n - 1; i++) {
            for (Edge e : edges) {
                final int src = e.src;
                final int dst = e.dst;
                final double w = e.w;
                // relax
                if (d[src] + w < d[dst]) {
                    d[dst] = d[src] + w;
                    p[dst] = src;
                    sp[dst] = e;
                }
            }
        }
        // Check for the presence of negative-weights cycles
        for (Edge e : edges) {
            final int src = e.src;
            final int dst = e.dst;
            final double w = e.w;

